// App.js
import React, { useState } from 'react';

function App() {
  const [mensagem, setMensagem] = useState('');

  const handleClick1 = () => {
    setMensagem('Você clicou no Input 1!');
  };

  const handleClick2 = () => {
    setMensagem('Você clicou no Input 2!');
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>Escolha um botão:</h1>
      <input type="button" value="Input 1" onClick={handleClick1} />
      <input type="button" value="Input 2" onClick={handleClick2} />
      {mensagem && (
        <p style={{ marginTop: '20px', color: 'green' }}>
          {mensagem}
        </p>
      )}
    </div>
  );
}

export default App;
